import { useEffect } from 'react';
import  './style/MainSection3.css';
export function MainSection3 ({ exposurePercentage = 100, loop = true })  {


  useEffect(() => {
    const handleScroll = () => {
      const counters = document.querySelectorAll('.scroll_on');

      counters.forEach((el) => {
        const rect = el.getBoundingClientRect();
        const winHeight = window.innerHeight;
        const contentHeight = rect.bottom - rect.top;

        if (
          rect.top <= winHeight - (contentHeight * exposurePercentage / 100) &&
          rect.bottom >= (contentHeight * exposurePercentage / 100)
        ) {
          el.classList.add('active');
        } 
      });
    };

    window.addEventListener('scroll', handleScroll);

    // 초기 스크롤 위치에서도 체크합니다.
    handleScroll();

    return () => {
      window.removeEventListener('scroll', handleScroll);
    };
  }, [exposurePercentage, loop]);


  const headingStyle = {
    marginBottom: '20px'
  };


  const containerStyle = {
    marginBottom: '50px',
    width: '800px',
    left: '100px',
    top: '10px',
    position: 'relative',
    zIndex: '-1'
  };

  return (
    <>    
